import React from 'react';
import './App.css';

function App() {
  return (
    <div className="terms-container">
      <div className="header">
        <h1>Terms and conditions</h1>
      </div>
      <div className="nav">
        <div className="nav-item active">Introduction</div>
        <div className="nav-item">Booking conditions</div>
        <div className="nav-item">Cancellation policy</div>
        <div className="nav-item">No-show policy</div>
        <div className="nav-item">Payment policy</div>
        <div className="nav-item">Privacy policy</div>
      </div>
      <div className="content">
        <div className="section">
          <h2>1. Introduction</h2>
          <p>The following terms and conditions apply to all bookings made by a guest through our website or the hotel directly...</p>
        </div>
        <div className="section">
          <h2>1.2. Booking Conditions</h2>
          {/* ...other sections */}
        </div>
        {/* ...other sections */}
      </div>
    </div>
  );
}

export default App;
